import React from "react";
import { Link } from "react-router-dom";
import './landing.css'; // Import the CSS file

const LandingPage = () => {
  return (
    <div style={{width: '100vw', height: '100vh', position: 'relative', background: '#FFF6EC', overflow: 'hidden'}}>
       <div className="login-container">
      <Link to="/login" className="login-link">
        Log In
      </Link>
    </div>
    <div className="container" style={{display: 'flex', flexDirection: 'row', justifyContent: 'space-between', alignItems: 'flex-start'}}>
  <div style={{width: '60%', paddingTop: 637, paddingBottom: 637, background: '#FFF6EC', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', display: 'flex'}}>
    <div style={{alignSelf: 'stretch', textAlign: 'center', justifyContent: 'center', display: 'flex', flexDirection: 'column', color: '#FF5501', fontSize: '5vw', fontFamily: 'Titan One', fontWeight: '400', wordWrap: 'break-word'}}>
      MUNCH MATCH
    </div>
    <div style={{width: 605, height: 87, paddingLeft: 143, paddingRight: 143, paddingTop: 18, paddingBottom: 18, background: 'radial-gradient(ellipse 489.26% 70.36% at 50.00% 50.00%, #FF7F36 0%, #F35100 59%)', borderRadius: 50, justifyContent: 'center', alignItems: 'center', gap: 10, display: 'flex'}}>
      <div style={{justifyContent: 'center', display: 'flex', flexDirection: 'column', color: 'white', fontSize: 48, fontFamily: 'Anuphan', fontWeight: '700', wordWrap: 'break-word'}}>Create account</div>
    </div>
  </div>
  <div style={{flex: 1, backgroundColor: '#f0f0f0', padding: '20px', textAlign: 'center'}}>
    Content 2
  </div>
</div>

  </div>
  );
};

export default LandingPage;
